import React from "react";
import classes from './Post.module.css'

const Post = () => {

    return (
        <div className={classes.item}>
            My posts
            <div className={classes.item}>
                <textarea></textarea>
                <button>Add post</button>
            </div>
            <div className={classes.item}> Post1</div>
            <div className={classes.item}>Post2</div>
        </div>
    )
}


export default Post
